import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route
} from 'react-router-dom';
import {
  Budget,
  Inventory,
  Reports,
  Recipes,
  Orders,
  Goals,
  Dashboard
} from './pages';

class App extends React.Component {
  render() {
    return (
      <Router>
        <Switch>
          <Route exact path='/dashboard'>
            <Dashboard />
          </Route>
        </Switch>
      </Router>
    )
  }
}
export default App;
